Fixes #784 

**Description**
Assign a UUID as the logical ID (and return it) of a newly created FHIR resource.

Additionally
- Remove the incorrect `@Transatction` annotation
- Rename `save` to `create` to distinguish it from `update`
- Remove the generic type parameter `R` for `create` and `update`
- Make `update` work with more than one resource

**Alternative(s) considered**
NA

